D_SOD-123:
  the: 8.0  # body angle in degrees
  #the_p: 0.0 # pin angle in degrees
  tb_s: 0.05  # top part of body is that much smaller
  c: 0.2  # pin thickness, body center part height
  R1: 0.12  # pin upper corner, inner radius
  R2: 0.12  # pin lower corner, inner radius
  S: 0.0  # pin top flat part length (excluding corner arc) - you can specify either S or L, the other will be calculated
  #L: 0.4  #  pin bottom flat part length (including corner arc)
  fp_s: False  # True for circular pinmark, False for square pinmark (useful for diodes)
  fp_r: 0.5  # first pin indicator radius
  fp_d: 0.2  # first pin indicator distance from edge
  fp_z: 0.01  # first pin indicator depth
  ef: 0.0  # fillet of edges  Note: bigger bytes model with fillet
  cc1: 0.12  # chamfer of the 1st pin corner
  D1: 2.75  # body length
  E1: 1.6  # body width
  E: 2.65   # body overall width  (E - E1) = 2 * (S + R1 + L)
  A1: 0.1  # body-board separation
  A2: 1.15  # body height
  b: 0.65  # pin width
  e: 1.27  # pin (center-to-center) distance
  npx: 0  # number of pins along X axis (width)
  npy: 1  # number of pins along y axis (length)
  epad: null  # e Pad
  excluded_pins: null  # no pin excluded
  model_name: D_SOD-123  # model name
  rotation: 0  # rotation if required
  type: 'diode'
  body_color_key: 'black body'
  pin_color_key: 'metal grey pins'
  mark_color_key: 'light brown label'
  destination_dir: 'Diode_SMD.3dshapes'
  source: 'https://assets.nexperia.com/documents/package-information/SOD123.pdf#page=2'

